import React from 'react'

const LogIn = async () => {

    const login = async (body, path) => {
        let res = await fetch('http://127.0.0.1:5000/login', {
            body,
            method: "POST"
        })
        alert(res.json())
        return res.json()
    }
    return (
        <div>
        <from>
            <input type="text" placeholder='email'></input>
            <input type="password" placeholder='password'></input>
            <input type="submit" onSubmit={() => login({
                                "email": "v@k.com",
                                "password": "123123"
                            }, )
                            }>LogIn</input>
        </from>
        </div>
  )
}

export default LogIn
